 On the sunny beaches of Saint Tropez, Jacques takes pictures of gorgeous girls. Alexia, his mistress, is the owner of the charm models agency he works for. Alas, with the economic crisis, it's harder and harder to close deals and the agency is in jeopardy. That is why Alexia is thrilled when Baron Swank, an important person of the press people, offers her to work for him. But what shameful activity is actually hid behind the Baron's honorability? And ... More
